column8:
24Vトラック専用！ 車用の扇風機です。<br> 羽は8インチ（約200mm）あるのでかなりパワフルな風が送風されます。<br> 必須夏物商品です！<br> <br> <br> エアコンの温度を無理に下げなくてもいいからガソリンの無駄を防ぎます。 <br>エアコン＋扇風機で車内に風の流れを作り、循環させることでクリーンでエコな快適空間に！<br>電源はシガーソケットに差し込むだけ！<br>サブバッテリーがあれば朝までぐっすり。車中泊にも最適！<br>首振り機能と強弱切り替え機能付き。<br>クリップが付いているので取付場所、自由自在！<br><br><br><br>●仕様 <br><br>入力電圧 DC24V <br>最大消費電流 （強/弱）：0.5A/0.45A <br>首振り角度 約60度 <br>取付様式 クリップ/ビス固定 <br>材質 羽根…ガード：ポリプロピレン/スチール<br>本体モーター部…ABS樹脂<br>支柱/クリップ…ABS樹脂 <br>羽根/ガード （羽根）200mm/（ガード）228mm <br>電源コードの長さ 約3m <br>本体サイズ W228×H285×D228mm <br>重量 約900g <br><br><br>※羽根の部分に手や物を入れないでください。<br><style type="text/css">
