★リニューアルされたパワーＨＩＤキット【24V用】の特徴は、照明としての基本性能を追求した従来品の基本性能をそのままに、より車両適用性をアップした商品となっております。<br>
 明るさや配光などの基本性能は【VR4・12V用】と同じです。<br>
 商用車での過酷な使用条件を想定した必要十分な防水性能が特徴です。リニューアルによりバルブ寿命を10%向上させました。<br>
 シングル・システムについて、ヘッド/フォグを兼用とし実用性と明るさを追求しました。<br>
＜簡単装着のシングル・システム＞<br>
■バッテリーが遠い24V用にバルブカプラーにて必要電源を確保するハーネスシステムを採用。<br>
■導電性に優れる「RG特製接点グリス※」を同梱。<br>
 ※グリスは全システムに同梱。<br>
＜ワンパッケージタイプ＞<br>
■ハロゲン仕様車をＨＩＤに変更する為に必要なパーツを１箱に揃えました。<br>
■信頼性の高い国内OEM製インバータ/イグナイタ別体タイプを採用。ヒューズハーネス防水タイプを採用。<br>
